import React from 'react'
import "./Hero.css"

export const Hero = (
    {
        MainTextOut,
        MainTextOth,
        SubText,
        MainTextSize,
        MainTextMargin,
        
    }
)=>
{
    return(
    <div className="Hero">
        <h1 className="HeroT"><span className="Outline">{MainTextOut}</span>{MainTextOth}</h1>
        <div className="HeroP">
            <p>{SubText}</p>
    </div>
        <button className="BeAMem">Become a Member</button>
    </div>
    );
};
